['Director, FMAP Ltd (trading as FMA) (company providing advice to overseas governments on efficiency, implementation and public sector reform) (as a Director of FMA the member may be personally involved in delivering professional advice to any of the following clients: Government of New South Wales – Ministry of Finance; Government of Canada – Treasury Board;
Government of Bahrain – Ministry of Finance and National Economy and Office of the First Deputy Prime Minister; Government of the Kingdom of Saudi Arabia – Ministry of Finance; Government of the Kurdistan Region of Iraq – Office of the Prime Minister; Government of the Republic of Kazakhstan – AIFC (Astana International Financial Centre))

']
